// src/components/Buttons.js
import React from 'react';

const Buttons = () => {
  return (
    <div className="buttons">
      <a href="/login" className="btn">Login</a>
      <a href="/signup" className="btn">Signup</a>
    </div>
  );
};

export default Buttons;
